# Base64 encoded PSEXECSVC1.9.exe
PSEXECSVC19=b64decode("")

class PsExecInit1_9(Structure):
    structure = (
        ('PacketSize', '<I'),
        ('PID', '<I'),
        ('Computer', '520s'),  
        ('Command', '520s'),   
        ('Arguments', '520s'),
        ('OthersOptions', '16385s'),  
        ('ElevateToSystem', '1s'),
        ('Interactif', '1s'),
        ('LogonUser', '1s'),
        ('RestrictedToken', '1s'),
        ('HighPrivToken', '1s'),
        ('OthersFlags', '16s'),
        ('Username', '520s=""'),
        ('Password', '520s=""'),
        ('Padding', '18s=""') 
    )

class RemComResponse(Structure):
    structure = (
        ('ErrorCode', '<L=0'),
        ('ReturnCode', '<L=0'),
    )

lock = Lock()

class PSEXECSVC:
    def __init__(self, username, password, domain, options):
        self.port = 445
        self.lmhash = ""
        self.nthash = ""
        self.domain = domain
        self.username = username
        self.password = password
        self.user = options.user
        self.system = options.system
        self.command = options.command
        self.aes_key = options.aes_key
        self.target = options.target_ip
        self.kdc_host = options.kdc_host
        self.arguments = options.arguments
        self.do_kerberos = options.do_kerberos
        self.service_name = options.service_name
        self.remote_binary_name = options.remote_binary_name

        if options.hashes:
            self.lmhash, self.nthash = options.hashes.split(":")
        
    def run(self):
        stringbinding = f"ncacn_np:{remoteName}[\pipe\svcctl]" 
        logging.debug(f"StringBinding: {stringbinding}")
        rpctransport = transport.DCERPCTransportFactory(stringbinding)
        rpctransport.set_dport(self.port)
        rpctransport.setRemoteHost(self.target)

        if hasattr(rpctransport, "set_credentials"):
            rpctransport.set_credentials(self.username, self.password, self.domain, self.lmhash, self.nthash, self.aes_key)

        rpctransport.set_kerberos(self.do_kerberos, self.kdc_host)
        rpctransport.preferred_dialect(SMB2_DIALECT_21)
        self.launch_pipes(rpctransport)

    def openPipe(self, s, tid, pipe, accessMask):
        pipeReady = False
        tries = 50
        while pipeReady is False and tries > 0:
            try:
                s.waitNamedPipe(tid,pipe)
                pipeReady = True
            except:
                tries -= 1
                time.sleep(2)
                pass

        if tries == 0:
            raise Exception("Pipe not ready, aborting")

        fid = s.openFile(tid, pipe, accessMask, creationOption=0x40, fileAttributes=0x80)
        return fid

    def launch_pipes(self, rpctransport):
        dce = rpctransport.get_dce_rpc()
        try:
            dce.connect()
        except Exception as e:
            if logging.getLogger().level == logging.DEBUG:
                import traceback
                traceback.print_exc()
            logging.critical(str(e))
            exit(1)

        global dialect
        dialect = rpctransport.get_smb_connection().getDialect()

        s = rpctransport.get_smb_connection()
        s.setTimeout(100000)

        try:

            PSEXECSVC_buffer = BytesIO()
            PSEXECSVC_buffer.write(PSEXECSVC19)
            PSEXECSVC_buffer.seek(0)

            installService = serviceinstall.ServiceInstall(rpctransport.get_smb_connection(), PSEXECSVC_buffer, self.service_name, self.remote_binary_name)
            installService.install()

            tid = s.connectTree('IPC$')
            logging.debug(f"Connecting to \\{self.remote_binary_name.split('.')[0]} initial named pipe")
            fid_main = self.openPipe(s, tid, f"\\{self.remote_binary_name.split('.')[0]}", 0x12019f)

            logging.debug("Sending PSExecSVC version 190 (BE000000)")
            s.writeNamedPipe(tid, fid_main, bytes.fromhex("BE000000"))
            version = s.readNamedPipe(tid, fid_main, 4)
            logging.debug(f"Received version from PSEXECSVC: {version}")

            init=PsExecInit1_9()
            init['PacketSize'] = 19032
            init['PID'] = os.getpid()
            random_string = "".join(random.choice(string.ascii_letters + string.digits) for _ in range(8))
            init['Computer'] = random_string.encode("utf-16le").ljust(520, b"\0")
            init['Command'] = f"{self.command}".encode('utf-16le').ljust(520, b"\0")
            init['Arguments'] = f"{self.arguments}".encode('utf-16le').ljust(520, b"\0")
            init['OthersOptions'] = "".encode('utf-16le').ljust(16385, b"\0")
            init['Interactif'] = bytes.fromhex("00")   
            init['RestrictedToken'] = bytes.fromhex("00")
            init['HighPrivToken'] = bytes.fromhex("01")
            init['LogonUser'] = bytes.fromhex("00")
            init['ElevateToSystem'] = bytes.fromhex("00")
            init['OthersFlags'] = bytes.fromhex("00000000000000000000ffffffff0100")
            init['Padding'] = bytes.fromhex("000000000000010000000000000000000000")

            if self.system:
                print(f"[+] Elevating to system")
                init['ElevateToSystem'] = bytes.fromhex("01")

            if self.user:
                print(f"[+] Remote LogonUser to enable SSO")
                init['Username'] = f'{self.domain}\\{self.username}'.encode('utf-16le').ljust(520, b'\0')
                init['Password'] = f'{self.password}'.encode('utf-16le').ljust(520, b'\0')
                init['LogonUser'] = bytes.fromhex("01")
            
            data = init.getData()
            logging.debug(f"Sending init packet to PSEXECSVC: {random_string}-{init['PID']} ({len(data)})")             
            s.writeNamedPipe(tid, fid_main, data)

            global LastDataSent
            LastDataSent = ""

            inpipe = f"\\{self.remote_binary_name.split('.')[0]}-{random_string}-{init['PID']}-stdin"
            logging.debug(f"Opening STDIN pip {inpipe}")
            stdin_pipe = RemoteStdInPipe(rpctransport, inpipe, smb.FILE_WRITE_DATA | smb.FILE_APPEND_DATA, installService.getShare())
            stdin_pipe.start()
                
            outpipe = f"\\{self.remote_binary_name.split('.')[0]}-{random_string}-{init['PID']}-stdout"
            logging.debug(f"Opening STDOUT pip {outpipe}")
            stdout_pipe = RemoteStdOutPipe(rpctransport, outpipe, smb.FILE_READ_DATA)
            stdout_pipe.start()
        
            errpipe = f"\\{self.remote_binary_name.split('.')[0]}-{random_string}-{init['PID']}-stderr"
            logging.debug(f"Opening STDERR pip {errpipe}")
            stderr_pipe = RemoteStdErrPipe(rpctransport, errpipe, smb.FILE_READ_DATA)
            stderr_pipe.start()

            ans = s.readNamedPipe(tid, fid_main, 64)

            if len(ans):
                retCode = RemComResponse(ans)
                logging.info(f"Process {self.command} finished with ErrorCode: { retCode['ErrorCode']}, ReturnCode: {retCode['ReturnCode']}")
            installService.uninstall()
            exit(retCode["ErrorCode"])

        except Exception as e:
            logging.debug(f"\nGot exception: {e}")
        except KeyboardInterrupt:
            logging.debug(f"\nCaught a keyboard interupt exception")
        finally:
            installService.uninstall()
            sys.stdout.flush()
            exit(1)


class Pipes(Thread):
    def __init__(self, transport, pipe, permissions, share=None):
        Thread.__init__(self)
        self.server = 0
        self.transport = transport
        self.credentials = transport.get_credentials()
        self.tid = 0
        self.fid = 0
        self.share = share
        self.port = transport.get_dport()
        self.pipe = pipe
        self.permissions = permissions
        self.daemon = True

    def connectPipe(self):
        try:
            lock.acquire()
            global dialect
            self.server = SMBConnection(self.transport.get_smb_connection().getRemoteName(), self.transport.get_smb_connection().getRemoteHost(), sess_port=self.port, preferredDialect=SMB2_DIALECT_21)
            user, passwd, domain, lm, nt, aesKey, TGT, TGS = self.credentials
            if self.transport.get_kerberos() is True:
                self.server.kerberosLogin(user, passwd, domain, lm, nt, aesKey, kdcHost=self.transport.get_kdcHost(), TGT=TGT, TGS=TGS)
            else:
                self.server.login(user, passwd, domain, lm, nt)
            lock.release()
            self.tid = self.server.connectTree("IPC$")

            self.server.waitNamedPipe(self.tid, self.pipe)
            self.fid = self.server.openFile(self.tid, self.pipe, self.permissions, creationOption = 0x40, fileAttributes = 0x80)
            self.server.setTimeout(1000000)
        except Exception as e:
            if logging.getLogger().level == logging.DEBUG:
                import traceback
                traceback.print_exc()
            logging.error(f"Error ({self.__class__}): {e}")


class RemoteStdOutPipe(Pipes):
    def __init__(self, transport, pipe, permisssions):
        Pipes.__init__(self, transport, pipe, permisssions)

    def run(self):
        self.connectPipe()
        while True:
            try:
                ans = self.server.readFile(self.tid, self.fid, 0, 1024)
            except:
                pass
            else:
                try:
                    global LastDataSent
                    if ans != LastDataSent:
                        sys.stdout.write(ans.decode("cp437"))
                        sys.stdout.flush()
                    else:
                        LastDataSent = ""
                    if LastDataSent > 10:
                        LastDataSent = ""
                except:
                    pass

class RemoteStdErrPipe(Pipes):
    def __init__(self, transport, pipe, permisssions):
        Pipes.__init__(self, transport, pipe, permisssions)

    def run(self):
        self.connectPipe()
        while True:
            try:
                ans = self.server.readFile(self.tid, self.fid, 0, 1024)
            except:
                pass
            else:
                try:
                    sys.stderr.write(ans.decode("cp437"))
                    sys.stderr.flush()
                except:
                    pass

class RemoteShell(cmd.Cmd):
    def __init__(self, server, port, credentials, tid, fid, share, transport):
        cmd.Cmd.__init__(self, False)
        self.prompt = "\x08"
        self.server = server
        self.transferClient = None
        self.tid = tid
        self.fid = fid
        self.credentials = credentials
        self.share = share
        self.port = port
        self.transport = transport
        self.intro = "[!] Press help for extra shell commands"

    def connect_transferClient(self):
        self.transferClient = SMBConnection("*SMBSERVER", self.server.getRemoteHost(), sess_port=self.port, preferredDialect=SMB2_DIALECT_21)
        user, passwd, domain, lm, nt, aesKey, TGT, TGS = self.credentials
        if self.transport.get_kerberos() is True:
            self.transferClient.kerberosLogin(user, passwd, domain, lm, nt, aesKey, kdcHost=self.transport.get_kdcHost(), TGT=TGT, TGS=TGS)
        else:
            self.transferClient.login(user, passwd, domain, lm, nt)

    def emptyline(self):
        self.send_data(b"\r\n")
        return

    def default(self, line):
        self.send_data(line.encode("cp437") + b"\r\n")

    def send_data(self, data, hideOutput = True):
        if hideOutput is True:
            global LastDataSent
            LastDataSent = data
        else:
            LastDataSent = ""
        for c in data:
            self.server.writeNamedPipe(self.tid, self.fid, bytes([c]))

class RemoteStdInPipe(Pipes):
    def __init__(self, transport, pipe, permisssions, share=None):
        self.shell = None
        Pipes.__init__(self, transport, pipe, permisssions, share)

    def run(self):
        self.connectPipe()
        self.shell = RemoteShell(self.server, self.port, self.credentials, self.tid, self.fid, self.share, self.transport)
        self.shell.cmdloop()

if __name__ == "__main__":
    print(version.BANNER)

    parser = argparse.ArgumentParser(add_help = True, description = "PSExecSVC remote orchestrator")
    parser.add_argument("target", action="store", help="[[domain/]username[:password]@]<targetName or address>")
    parser.add_argument("-command", type=str, default="cmd.exe", help="Command to execute on the remote target (default:cmd.exe)")
    parser.add_argument("-arguments", type=str, default="", help="Arguments to pass to the command")
    parser.add_argument("-ts", action="store_true", help="Adds timestamp to every logging output")
    parser.add_argument("-debug", action="store_true", help="Turn DEBUG output ON")
    parser.add_argument("-service-name", action="store",  default = "PSEXESVC", help="The name of the service used to trigger the payload")
    parser.add_argument("-remote-binary-name", action="store", default="PSEXECSVC.exe", help="This will be the name of the executable uploaded on the target")
    
    privs = parser.add_mutually_exclusive_group(required=True)
    privs.add_argument("-system", action="store_true", help="Elevate to SYSTEM")
    privs.add_argument("-user", action="store_true", help="Connects as the specified user")

    group = parser.add_argument_group("authentication")
    group.add_argument("-hashes", action="store", metavar = "LMHASH:NTHASH", help="NTLM hashes, format is LMHASH:NTHASH")
    group.add_argument("-no-pass", action="store_true", help="Don't ask for password (useful for -k)")
    group.add_argument("-k", dest="do_kerberos", action="store_true", help="Use Kerberos authentication (from KRB5CCNAME or via given credentials)")
    group.add_argument("-aes-key", action="store", metavar="hex key", help="AES key to use for Kerberos Authentication (128 or 256 bits)")
    group.add_argument("-key-tab", action="store", help="Read keys for SPN from keytab file")
    group.add_argument("-dc-ip", dest="kdc_host", action="store", metavar="ip address", help="IP Address of the domain controller. If omitted it will use the domain part (FQDN) specified in the target parameter")
    group.add_argument("-target-ip", action="store", metavar="ip address", help="IP Address of the target machine. If omitted it will use whatever was specified as target. This is useful when target is the NetBIOS name and you cannot resolve it")

    if len(sys.argv) == 1:
        parser.print_help()
        exit(1)

    options = parser.parse_args()
    logger.init(options.ts)

    if options.debug is True:
        logging.getLogger().setLevel(logging.DEBUG)
        logging.debug(version.getInstallationPath())
    else:
        logging.getLogger().setLevel(logging.INFO)

    domain, username, password, remoteName = parse_target(options.target)

    if (options.user and options.hashes) or (options.user and not (domain or username or password)):
        logging.error("Option -user requires cleartext credentials and domain name")
        exit(1)

    if not domain:
        domain = ""

    if options.key_tab is not None:
        Keytab.loadKeysFromKeytab(options.key_tab, username, domain, options)
        options.k = True

    if options.target_ip is None:
        options.target_ip = remoteName

    if password == "" and username != "" and options.hashes is None and options.no_pass is False and options.aes_key is None:
        from getpass import getpass
        password = getpass("Password:")

    if options.aes_key is not None:
        options.k = True

    PSEXECSVC(username, password, domain, options).run()